import React from 'react';
import './App.css';
import colors from './data.js';


class App extends React.Component {
  constructor() {
    super();

    this.handledChange = this.handleChange.bind(this);

    this.state= {
      filterText: ""
    }
  }

  handledChange() {
    console.log('corno');
  }

  render () {
    return <div>
      <div><input type="text" onChange={this.handledChange} /></div>
      {colors.map((color, index) => (<div key={index}>{color.name}</div>))}
    </div>
  };
}

export default App;
